=head1 DESCRIPTION

An object that represents the price performance target settings for the
workgroup.

=head1 ATTRIBUTES


=head2 Level => Int

The target price performance level for the workgroup. Valid values
include 1, 25, 50, 75, and 100. These correspond to the price
performance levels LOW_COST, ECONOMICAL, BALANCED, RESOURCEFUL, and
HIGH_PERFORMANCE.


=head2 Status => Str

Whether the price performance target is enabled for the workgroup.



